import React from 'react';

const GoogleMap = ({ center }) => {
    // Assuming center is an object with lat and lng properties
    const { lat, lng } = center;

    return (
        <div style={{ width: '100%', height: '400px' }}>
            {/* Embed Google Maps with the specified center */}
            <iframe
                title="Google Map"
                width="100%"
                height="100%"
                frameBorder="0"
                style={{ border: 0 }}
                src={`https://www.google.com/maps/embed/v1/view?key=YOUR_API_KEY&center=${lat},${lng}&zoom=15`}
                allowFullScreen
            ></iframe>
        </div>
    );
};

export default GoogleMap;
